import React from "react";
import "./Sidebar.css";
import Dashboard from './img/dashboard.png'
import Graduation_cap from './img/graduation-cap.png'
import Trolley from './img/trolley.png'
import Settings from './img/setting.png'
import Notification from './img/bell.png'

const Sidebar = () => {
  return (
    <div className="sidebar">
      <a href="#dashboard">
        <img src={Dashboard} alt="menu icon"/>
        Dashboard
      </a>
      <a href="#education">
        <img src={Graduation_cap}  alt='Education icon'/>
        Education</a>
      <a href="#store">
        <img src={Trolley} alt= 'Store icon '/>
        Store</a>
      <a href="#notifications">
        <img src={Notification} alt='settings icon'/>
        Notification</a>
      <a href="#settings">
        <img src={Settingsetting} alt='Settings icon'/>
        Settings</a>
    </div>
  );
};

export default Sidebar;
